// NavBar.js
import React from 'react';
import './NavBar.css';

const NavBar = () => {
  return (
    <div className="navbar">
      <strong><a href="/about" className="nav-item">About</a></strong>
      <strong><a href="/ak" className="nav-item nav-item-middle">AK</a></strong>
      <strong><a href="/projects" className="nav-item">Projects</a></strong>
    </div>
  );
};

export default NavBar;
